text:
Tem a ver com vontade;
Tem a ver com seguir em frente;
Tem a ver com invenção que, talvez, esteja entre o que temos de melhor nessa vida.

Tem a ver com ciclos;
Tem a ver com começo e recomeço;
Tem a ver com esperança.

E a esperança ainda tem de ter o tamanho dos meus amigos... https://t.co/7IX2ombVcJ
